import { useStyles } from "./styles";
import { Grid } from '@material-ui/core';

function Main() {
    const classes = useStyles();
    return (
        <div>
            <Grid container>
                <Grid item xs={12} sm={8}>
                    Image
                </Grid>
                <Grid item>
                    Content
                </Grid>
            </Grid>
        </div>
    )
}

export default Main
